Hate I gotta do this for my money 
@cba_updates @cba.basketball 

As a 13 year veteran, I am frustrated that I have to publicly send this message. I patiently waited, but I have too much respect for my craft to not bring attention to this matter. I signed with Sichuan Blue Whales, for the second time, to finish the 23/24 season. I also played with this club in 2019 and was excited to return. It is not easy to join a club that is already in the midst of their season, but I was appreciative of the opportunity and gave my all. I am very disappointed in Sichuan Blue Whales Basketball Club for not paying any of my salary. I have spoken with the CBA already and am currently in the process of filing for arbitration with my agent. I want to bring awareness of this situation in the meantime for any player that is currently being pursued by Sichuan. This is not the normal circumstance for the clubs of the Chinese Basketball Association.  I have played for three clubs in this league and never had this problem. I hope to resolve this as soon as possible by receiving my full salary that I am owed. @cba.basketball @cba_updates @fiba

@cred.cafe 
